Here is a step-by-step guide to creating a React, Node, and Express.js web app for creating, adding, and showing dummy data. I'll also cover how to deploy the code after creating a build.

**Step 1: Set up the project structure**

Create a new folder for your project and navigate to it in your terminal or command prompt. Run the following command to create a new React app:
```bash
npx create-react-app my-app
```
This will create a new React app in a folder called `my-app`.

**Step 2: Create a new Node and Express.js server**

Create a new folder inside the `my-app` folder called `server`. Navigate to the `server` folder and run the following command to create a new Node.js project:
```bash
npm init -y
```
This will create a new `package.json` file in the `server` folder.

Install Express.js by running the following command:
```bash
npm install express
```
Create a new file called `server.js` in the `server` folder and add the following code:
```javascript
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

const dummyData = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
];

app.get('/api/data', (req, res) => {
  res.json(dummyData);
});

app.post('/api/data', (req, res) => {
  const { name, age } = req.body;
  const newData = { id: dummyData.length + 1, name, age };
  dummyData.push(newData);
  res.json(newData);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001 and has two endpoints: one to retrieve the dummy data and one to add new data.

